import Card from './card/card.container';
import styles from './home.module.css';

const HomeView = ({ products }) => 
  <div className>
    <div>
      <input></input>
    </div>
    <div className={styles.container} >
      {products.map(product => 
        <Card product={product} />
      )}
    </div>
  </div>

export default HomeView;
